app.use(express.urlencoded({ extended: false })); // Middleware para formularios

// Importar las rutas creadas para nuestras APIs
import TarifaRuta from './routes/Parking.routes.js';

// Aplicar configuración de la ruta
app.use(TarifaRuta); 

export default app;

